import ExpenseItem from "./component/ExpenseItem";
import ExpenseInpute from "./component/ExpenseInpute";
function App() {
  let expenceDate=new Date(2021,3,28);
  let expenceTitle="school fee";
  let expenceAmount=200;
  return (
    <div className="App">
      <ExpenseInpute />
      <h1>Lets Start</h1>
      <ExpenseItem date={expenceDate}
      title={expenceTitle}
      amount={expenceAmount} />
         </div>
  );
}

export default App;
